import './css/App.css';
import './css/Global.css'

import Header from "./components/Header"
import Section from './components/Section';

function App() {
  return (
    <>
      <Header />
      <Section id="Biography">Biography</Section>
      <Section id="Skills">Biography</Section>
      <Section id="Experience">Biography</Section>
      <Section id="Projects">Biography</Section>
      <Section id="Quotes">Biography</Section>
    </>
  );
}

export default App;
